.future-simulator-container {
  padding: 20px;
  background: #1a1a2e;
  color: #eee;
  border-radius: 10px;
}

.current-situation {
  background: #16213e;
  padding: 15px;
  border-radius: 8px;
  margin-bottom: 20px;
}

.score-chart-container {
  background: #16213e;
  padding: 15px;
  border-radius: 8px;
  margin-bottom: 20px;
}

.cards-grid {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
  gap: 15px;
  margin-top: 15px;
}

.scenario-card {
  background: #16213e;
  border: 1px solid #0f3460;
  border-radius: 8px;
  padding: 15px;
  cursor: pointer;
  transition: all 0.3s;
}

.scenario-card:hover {
  transform: translateY(-2px);
  box-shadow: 0 5px 15px rgba(94, 84, 142, 0.3);
}

.scenario-card.recommended {
  border-color: #e94560;
  background: linear-gradient(135deg, #16213e, #1a1a2e);
}

.score-badge {
  display: inline-block;
  padding: 4px 8px;
  border-radius: 4px;
  font-weight: bold;
}

.score-high { background: #10b981; }
.score-medium { background: #f59e0b; }
.score-low { background: #ef4444; }

.modal {
  position: fixed;
  z-index: 1000;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0,0,0,0.8);
}

.modal-content {
  background-color: #16213e;
  margin: 5% auto;
  padding: 20px;
  border: 1px solid #0f3460;
  width: 90%;
  max-width: 600px;
  border-radius: 10px;
  max-height: 80vh;
  overflow-y: auto;
}

.close {
  color: #aaa;
  float: right;
  font-size: 28px;
  font-weight: bold;
  cursor: pointer;
}

.close:hover { color: #fff; }
